import os
import pandas as pd
from typing import Dict, List

class FileValidator:
    def __init__(self, file_path: str):
        self.file_path = file_path

    def validate_file_format(self) -> bool:
        """Validate file format."""
        file_extension = os.path.splitext(self.file_path)[1]
        if file_extension in ['.csv', '.txt', '.json']:
            return True
        return False

    def check_for_missing_required_elements(self, required_elements: List[str]) -> List[str]:
        """Check for missing required elements in the file."""
        missing_elements = []
        if os.path.splitext(self.file_path)[1] == '.csv':
            df = pd.read_csv(self.file_path)
            for element in required_elements:
                if element not in df.columns:
                    missing_elements.append(element)
        return missing_elements


